        public class Point
        {
            public double X { get; set; }
            public double Y { get; set; }

            public Point(double x, double y)
            {
                X = x;
                Y = y;
            }

            public override string ToString() => $"({X}, {Y})";
        }

        public class Line
        {
            public double A { get; set; }
            public double B { get; set; }
            public double C { get; set; }

            public Line(double a, double b, double c)
            {
                A = a;
                B = b;
                C = c;
            }

            public double GetPointValue(Point point) => A * point.X + B * point.Y + C;

            public static Line FromTwoPoints(Point p1, Point p2)
            {
                double a = p1.Y - p2.Y;
                double b = p2.X - p1.X;
                double c = p1.X * p2.Y - p2.X * p1.Y;
                return new Line(a, b, c);
            }
        }

        private static List<Point> ParsePoints(string input)
        {
            return input.Split('|')[1]
                .Trim('(', ')')
                .Split(new[] { ") (" }, StringSplitOptions.RemoveEmptyEntries)
                .Select(s =>
                {
                    var parts = s.Split(',');
                    return new Point(double.Parse(parts[0]), double.Parse(parts[1]));
                })
                .ToList();
        }

        public static bool ArePointsOnSameSide(Line line, List<Point> points, Point extreme1, Point extreme2)
        {
            Point? referencePoint = points.FirstOrDefault(p =>
                Math.Abs(line.GetPointValue(p)) > 1e-9 && !IsCloseTo(p, extreme1) && !IsCloseTo(p, extreme2));

            if (referencePoint == null)
            {
                return true;
            }

            double initialSign = Math.Sign(line.GetPointValue(referencePoint));
            foreach (var point in points)
            {
                if (IsCloseTo(point, extreme1) || IsCloseTo(point, extreme2)) continue;

                double value = line.GetPointValue(point);
                if (Math.Abs(value) > 1e-9 && Math.Sign(value) != initialSign)
                {
                    return false;
                }
            }

            return true;
        }

        private static List<Point> SortPoints(List<Point> points)
        {
            var sortedPoints = new List<Point>();

            Point minXPoint = points.OrderBy(p => p.X).ThenBy(p => p.Y).First();
            Point maxXPoint = points.OrderByDescending(p => p.X).ThenBy(p => p.Y).First();
            Point minYPoint = points.OrderBy(p => p.Y).ThenBy(p => p.X).First();
            Point maxYPoint = points.OrderByDescending(p => p.Y).ThenBy(p => p.X).First();

            sortedPoints.Add(minXPoint);
            sortedPoints.Add(maxYPoint);
            sortedPoints.Add(maxXPoint);
            sortedPoints.Add(minYPoint);

            return sortedPoints;
        }

        private static bool IsCloseTo(Point p1, Point p2, double threshold = 1e-9)
        {
            return Math.Abs(p1.X - p2.X) < threshold && Math.Abs(p1.Y - p2.Y) < threshold;
        }

        public static string DetermineShape(List<Point> points)
        {
            // Найти экстремальные значения
            double MinX = points.Min(p => p.X);
            double MaxX = points.Max(p => p.X);
            double MinY = points.Min(p => p.Y);
            double MaxY = points.Max(p => p.Y);

            // Найти экстремальные точки
            var extremePoints = points.Where(p =>
                Math.Abs(p.X - MinX) < 1e-9 ||
                Math.Abs(p.X - MaxX) < 1e-9 ||
                Math.Abs(p.Y - MinY) < 1e-9 ||
                Math.Abs(p.Y - MaxY) < 1e-9).ToList();

            // Если экстремальных точек <= 3, это треугольник
            if (extremePoints.Count <= 3)
                return "triangle";

            // Проверить, являются ли остальные точки внутри прямоугольника
            bool isRectangle = points.All(p =>
                (MinX <= p.X && p.X <= MaxX) && (MinY <= p.Y && p.Y <= MaxY));

            // Если все точки лежат внутри или на границах
            if (isRectangle)
                return "rectangle";

            // Если не прямоугольник, предполагаем, что это эллипс
            return "ellipse";
        }

